(1, 'Board Of Elementary Examination, Gilgit Division', 'Mohammad Azam Khan', '/images/1640182853-orig-minister-image.png', '<table style=\"height: 107px; width: 100%; border-collapse: collapse; border-style: none;\" border=\"1\">\n        <tbody>\n        <tr style=\"height: 50px;\">\n        <td style=\"width: 100%; height: 50px; border-style: none; text-align: center;\"><strong>(FROM THE HONORABLE MR. RAJA AZAM KHAN MINISTER EDUCATION GILGIT BALTISTAN)</strong></td>\n        </tr>\n        <tr style=\"height: 18px;\">\n        <td style=\"width: 100%; height: 18px; border-style: none; text-align: center;\">\n        <p>Quality education is an essential tool for any nation to achieve progress and success. It develops confidence and helps to build the entire nation. Hence, in acheiving this goal, school education plays a key role in nations life. Education is a dire need for both men and women. Furthermore, educated and trained people can contribute effectively to construct a developed and enlightened society. Consequently, the nurtured and responsible citizens of the society build the future of the country. Moreover, the quality education makes people perfect and nobel.</p>\n        <p>&nbsp; &nbsp; &nbsp;It is an immense pleasure to see the progress of the government schools of Gilgit-Baltistan. The government schools always put forward their tremendous effort in nation building.</p>\n        <p>&nbsp; &nbsp; May Allah almighty bestow us strength and will to carry this great mission of spreading the light of education.</p>\n        </td>\n        </tr>\n        </tbody>\n        </table>', 'Iqbal Hussain', '/images/1640182853-orig-secretary-image.png', '<table style=\"height: 107px; width: 100%; border-collapse: collapse; border-style: none;\" border=\"1\">\n        <tbody>\n        <tr style=\"height: 50px;\">\n        <td style=\"width: 100%; height: 50px; border-style: none; text-align: center;\"><strong>(FROM THE HONORABLE MR. IQBAL HUSSAIN SECRETARY EDUCATIO